import React from 'react';
import vid from '../../my-project/src/Vid/lv_0_20230402134428_1.mp4'

const About = () => {
  return (
    <div className='background-about'>
      <div className='vid1'>
        <video > src={vid} autoPlay='true' className='vid py-md-5'  </video> 
      </div>
    </div>
  );
}

export default About;
